import React from "react";
import Popup from "../components/Popup";

const ShopPage = (props)=> {
    const shops = props.shop

    return(
        <ul>
            {shops.filter(shop=>shop.count>0).map(shop=><Popup key={shop.id}  {...shop}/>)}
        </ul>
    )
}

export default ShopPage;
